import React from 'react';
import { 
  Card, 
  CardContent, 
  Typography, 
  Box, 
  Divider,
  Alert,
  AlertTitle,
  Collapse,
  IconButton,
  Chip
} from '@mui/material';
import WarningIcon from '@mui/icons-material/Warning';
import CheckCircleIcon from '@mui/icons-material/CheckCircle';
import ExpandMoreIcon from '@mui/icons-material/ExpandMore';
import ExpandLessIcon from '@mui/icons-material/ExpandLess';

// Dictionary for mapping numeric codes to human-readable values (same as in PatientForm)
const valueMappings = {
  Gender: {
    0: 'Male',
    1: 'Female'
  },
  Ethnicity: {
    0: 'Caucasian',
    1: 'African American',
    2: 'Asian',
    3: 'Other'
  },
  EducationLevel: {
    0: 'None',
    1: 'High School',
    2: 'Bachelor\'s',
    3: 'Higher'
  },
  Smoking: {
    0: 'No',
    1: 'Yes'
  },
  FamilyHistoryAlzheimers: {
    0: 'No',
    1: 'Yes'
  },
  CardiovascularDisease: {
    0: 'No',
    1: 'Yes'
  },
  Diabetes: {
    0: 'No',
    1: 'Yes'
  },
  Depression: {
    0: 'No',
    1: 'Yes'
  },
  HeadInjury: {
    0: 'No',
    1: 'Yes'
  },
  Hypertension: {
    0: 'No',
    1: 'Yes'
  },
  MemoryComplaints: {
    0: 'No',
    1: 'Yes'
  },
  BehavioralProblems: {
    0: 'No',
    1: 'Yes'
  },
  Confusion: {
    0: 'No',
    1: 'Yes'
  },
  Disorientation: {
    0: 'No',
    1: 'Yes'
  },
  PersonalityChanges: {
    0: 'No',
    1: 'Yes'
  },
  DifficultyCompletingTasks: {
    0: 'No',
    1: 'Yes'
  },
  Forgetfulness: {
    0: 'No',
    1: 'Yes'
  }
};

const PredictionResult = ({ prediction }) => {
  const [showDetails, setShowDetails] = React.useState(false);
  const isHighRisk = prediction.risk === 'High';

  const formatParameterValue = (param, value) => {
    // Check if this parameter has a human-readable mapping
    if (valueMappings[param] && valueMappings[param][value] !== undefined) {
      return valueMappings[param][value];
    }

    // Otherwise format as before
    if (typeof value === 'number') {
      // Format number to 3 decimal places if it has decimals
      return Number.isInteger(value) ? value : value.toFixed(3);
    }
    return value;
  };

  // Helper function to format model name nicely
  const formatModelName = (modelName) => {
    const modelMappings = {
      'rf': 'Random Forest',
      'xgboost': 'XGBoost',
      'logistic': 'Logistic Regression',
      'svm': 'Support Vector Machine',
      'knn': 'K-Nearest Neighbors',
      'nn': 'Neural Network'
    };

    return modelMappings[modelName] || modelName;
  };

  return (
    <Card sx={{ 
      mb: 3, 
      bgcolor: isHighRisk ? 'rgba(244, 67, 54, 0.05)' : 'rgba(76, 175, 80, 0.05)',
      borderLeft: isHighRisk ? '4px solid #f44336' : '4px solid #4caf50',
      boxShadow: '0 4px 8px rgba(0,0,0,0.1)'
    }}>
      <CardContent>
        <Box sx={{ mb: 2, display: 'flex', alignItems: 'center', justifyContent: 'space-between' }}>
          <Typography variant="h6" color={isHighRisk ? 'error' : 'success'} sx={{ fontWeight: 'bold' }}>
            {isHighRisk ? 'High Risk of Alzheimer\'s' : 'Low Risk of Alzheimer\'s'}
          </Typography>
          <Chip 
            icon={isHighRisk ? <WarningIcon /> : <CheckCircleIcon />}
            label={isHighRisk ? 'High Risk' : 'Low Risk'} 
            color={isHighRisk ? 'error' : 'success'}
            variant="outlined"
          />
        </Box>

        <Alert 
          severity={isHighRisk ? "error" : "success"}
          icon={isHighRisk ? <WarningIcon /> : <CheckCircleIcon />}
          sx={{ mb: 2 }}
        >
          <AlertTitle>{isHighRisk ? "Medical Attention Recommended" : "Healthy Profile Detected"}</AlertTitle>
          {isHighRisk 
            ? "The model indicates a high risk of Alzheimer's disease based on the provided parameters. Please consult a healthcare professional."
            : "The model indicates a low risk of Alzheimer's disease based on the provided parameters. Continue with regular health check-ups."
          }
        </Alert>

        <Box sx={{ 
          display: 'flex', 
          flexDirection: 'column', 
          p: 2, 
          borderRadius: 1, 
          bgcolor: 'background.paper',
          mb: 2
        }}>
          <Box sx={{ display: 'flex', justifyContent: 'space-between', mb: 1 }}>
            <Typography variant="body2" color="text.secondary">
              Model Used:
            </Typography>
            <Typography variant="body2" fontWeight="bold">
              {formatModelName(prediction.model_type || "Unknown")}
            </Typography>
          </Box>

          <Box sx={{ display: 'flex', justifyContent: 'space-between', mb: 1 }}>
            <Typography variant="body2" color="text.secondary">
              Model Accuracy:
            </Typography>
            <Typography variant="body2" fontWeight="bold">
              {(prediction.accuracy * 100).toFixed(1)}%
            </Typography>
          </Box>

          {prediction.roc_auc && (
            <Box sx={{ display: 'flex', justifyContent: 'space-between' }}>
              <Typography variant="body2" color="text.secondary">
                ROC AUC Score:
              </Typography>
              <Typography variant="body2" fontWeight="bold" color="secondary.dark">
                {(prediction.roc_auc * 100).toFixed(1)}%
              </Typography>
            </Box>
          )}
        </Box>

        {prediction.parameters && Object.keys(prediction.parameters).length > 0 && (
          <>
            <Box 
              sx={{ 
                display: 'flex', 
                alignItems: 'center', 
                mb: 1,
                cursor: 'pointer',
                '&:hover': {
                  color: 'primary.main',
                }
              }}
              onClick={() => setShowDetails(!showDetails)}
            >
              <Typography variant="body2" color={showDetails ? 'primary.main' : 'text.primary'}>
                <strong>Model Hyperparameters</strong>
              </Typography>
              <IconButton size="small">
                {showDetails ? <ExpandLessIcon fontSize="small" /> : <ExpandMoreIcon fontSize="small" />}
              </IconButton>
            </Box>

            <Collapse in={showDetails}>
              <Box 
                sx={{ 
                  ml: 2, 
                  mb: 2,
                  p: 1.5,
                  borderRadius: 1,
                  backgroundColor: 'rgba(0, 0, 0, 0.02)'
                }}
              >
                {Object.entries(prediction.parameters).map(([param, value]) => (
                  <Typography key={param} variant="body2" sx={{ mb: 0.5 }}>
                    <strong>{param}:</strong> {formatParameterValue(param, value)}
                  </Typography>
                ))}
              </Box>
            </Collapse>
          </>
        )}

        <Divider sx={{ my: 2 }} />

        <Typography variant="caption" color="text.secondary" sx={{ fontStyle: 'italic', display: 'block', textAlign: 'center' }}>
          <strong>DISCLAIMER:</strong> This is a prediction tool and not a medical diagnosis.
          Please consult a healthcare professional for proper evaluation.
        </Typography>
      </CardContent>
    </Card>
  );
};

export default PredictionResult;
